@rickyolgiati @Mov5Stelle Sarei cauto...
"Il Patto di stabilità, si legge nel documento, “deve garantire la crescita, la sostenibilità del debito e investimenti sostenibili ed ecologici”."

In altre parole, ok al debito che foraggia aziende tedesche, per il resto (sanità, welfare, ecc..) ok ad austerità.

Siamo cresciuti, la crescita è cambiamento. Nel 2007 c'erano 25 condannati in primo grado in Parlamento, questo, anche grazie a noi, oggi non sarebbe più possibile.

@RicRicciardi ha rilasciato un'intervista a La Repubblica. Ecco qui il testo integrale 👇🏻
